<!DOCTYPE html>
<html lang="bn">
<head>
    <meta charset="UTF-8">

    <link href="https://fonts.maateen.me/kalpurush/font.css" rel="stylesheet">
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            background: transparent;
            color: transparent;
            padding: 20px;
            transition: filter 0.5s ease;
            font-family: 'Kalpurush', sans-serif;
        }
        
        /* Popup Styles */
        .popup-overlay {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background-color: rgba(0, 0, 0, 0.5);
            backdrop-filter: blur(5px);
            display: flex;
            align-items: center;
            justify-content: center;
            z-index: 1000;
            opacity: 0;
            visibility: hidden;
            transition: opacity 0.5s ease, visibility 0.5s ease;
        }
        
        .popup-overlay.active {
            opacity: 1;
            visibility: visible;
        }
        
        .popup-container {
            width: 80%;
            max-width: 500px;
            background: linear-gradient(135deg, #ffffff, #f9f9f9);
            border-radius: 20px;
            padding: 30px;
            box-shadow: 0 20px 50px rgba(0, 0, 0, 0.3);
            position: relative;
            animation: popupAppear 0.5s ease forwards;
        }
        
        @keyframes popupAppear {
            0% { transform: scale(0.8); opacity: 0; }
            100% { transform: scale(1); opacity: 1; }
        }
        
        .close-btn {
            position: absolute;
            top: 15px;
            right: 20px;
            background: none;
            border: none;
            font-size: 2rem;
            color: #b21f1f;
            cursor: pointer;
            transition: transform 0.3s ease;
            font-family: 'Kalpurush', sans-serif;
        }
        
        .close-btn:hover {
            transform: scale(1.2);
        }
        
        .popup-header {
            text-align: center;
            margin-bottom: 25px;
            padding-bottom: 15px;
            border-bottom: 2px solid #eee;
        }
        
        .popup-header h2 {
            color: #1a2a6c;
            font-size: 1.8rem;
            font-weight: 700;
            font-family: 'Kalpurush', sans-serif;
        }
        
        .popup-content {
            margin-bottom: 25px;
        }
        
        .popup-message {
            font-size: 1.15rem;
            line-height: 1.9;
            color: #222;
            margin-bottom: 25px;
            text-align: center;
            font-weight: 500;
            font-family: 'Kalpurush', sans-serif;
            padding: 0 10px;
        }
        
        .popup-buttons {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            gap: 15px;
            margin-bottom: 20px;
        }
        
        .popup-btn {
            padding: 14px 28px;
            border: none;
            border-radius: 50px;
            font-size: 1.1rem;
            font-weight: 600;
            cursor: pointer;
            transition: all 0.3s ease;
            min-width: 160px;
            display: flex;
            align-items: center;
            justify-content: center;
            text-decoration: none;
            font-family: 'Kalpurush', sans-serif;
        }
        
        .support-btn {
            background: linear-gradient(135deg, #1a2a6c, #3a5fc9);
            color: white;
        }
        
        .ads-btn {
            background: linear-gradient(135deg, #b21f1f, #e74c3c);
            color: white;
        }
        
        .inbox-btn {
            background: linear-gradient(135deg, #27ae60, #2ecc71);
            color: white;
        }
        
        .popup-btn:hover {
            transform: translateY(-5px);
            box-shadow: 0 10px 20px rgba(0, 0, 0, 0.2);
        }
        
        .countdown-container {
            display: flex;
            align-items: center;
            justify-content: center;
            margin-top: 20px;
            padding-top: 15px;
            border-top: 1px dashed #ddd;
        }
        
        .countdown-text {
            font-size: 1.05rem;
            color: #666;
            margin-right: 10px;
            font-family: 'Kalpurush', sans-serif;
        }
        
        .countdown-timer {
            font-size: 1.6rem;
            font-weight: bold;
            color: #b21f1f;
            background-color: #f8f8f8;
            padding: 5px 15px;
            border-radius: 10px;
            min-width: 70px;
            text-align: center;
            font-family: 'Kalpurush', sans-serif;
        }
        
        .footer-note {
            text-align: center;
            font-size: 0.95rem;
            color: #777;
            margin-top: 30px;
            font-family: 'Kalpurush', sans-serif;
            line-height: 1.5;
        }
        
        /* Loader/Initial screen styles */
        .initial-loader {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            background: rgba(0, 0, 0, 0);
            color: transparent;
            z-index: 2000;
            transition: opacity 0.5s ease;
        }
        
        .initial-loader.hidden {
            opacity: 0;
            pointer-events: none;
        }
        
        .loader-text {
            font-size: 1.5rem;
            margin-top: 20px;
            text-align: center;
            padding: 0 20px;
            color: transparent;
            font-family: 'Kalpurush', sans-serif;
        }
        
        .loader-timer {
            font-size: 2rem;
            font-weight: bold;
            margin-top: 15px;
            background: rgba(255, 255, 255, 0);
            padding: 10px 25px;
            border-radius: 10px;
            color: transparent;
            font-family: 'Kalpurush', sans-serif;
        }
        
        /* Responsive Design */
        @media (max-width: 768px) {
            .popup-container {
                width: 90%;
                padding: 25px 20px;
            }
            
            .popup-buttons {
                flex-direction: column;
                align-items: center;
            }
            
            .popup-btn {
                width: 100%;
                max-width: 250px;
            }
            
            .popup-message {
                font-size: 1.1rem;
                line-height: 1.7;
            }
        }
        
        @media (max-width: 480px) {
            .popup-container {
                width: 95%;
                padding: 20px 15px;
            }
            
            .popup-header h2 {
                font-size: 1.6rem;
            }
            
            .popup-message {
                font-size: 1.05rem;
                line-height: 1.6;
            }
            
            .popup-btn {
                padding: 12px 20px;
                font-size: 1.05rem;
            }
            
            .countdown-timer {
                font-size: 1.5rem;
            }
        }
    </style>
</head>
<body>
    <!-- Initial Loader/Transparent Screen -->
    <div class="initial-loader" id="initialLoader">
        <div class="loader-timer" id="loaderTimer"></div>
        <div class="loader-text">   <span id="timerText"> </span></div>
    </div>
    
    <!-- Popup Overlay -->
    <div class="popup-overlay" id="popupOverlay">
        <div class="popup-container">
            <button class="close-btn" id="closePopupBtn">&times;</button>
            
            <div class="popup-header">
                <h2>   </h2>
            </div>
            
            <div class="popup-content">
                <p class="popup-message">
                             ,    Support US          
                </p>
                
                <div class="popup-buttons">
                    <a href="#" class="popup-btn support-btn" id="supportBtn" target="_blank">Support US</a>
                    <a href="#" class="popup-btn ads-btn" id="adsBtn" target="_blank">Ads Show</a>
                    <a href="https://contact2.me/lpMKn8" class="popup-btn inbox-btn" id="inboxBtn" target="_blank">Inbox Us</a>
                </div>
                
                <div class="countdown-container">
                    <span class="countdown-text"> :</span>
                    <div class="countdown-timer" id="popupCountdown"></div>
                </div>
            </div>
            
            <div class="footer-note">
                          
            </div>
        </div>
    </div>

    <script>
        // Adsterra smart links array
        const adsterraLinks = [
            "https://programmesheadstoneconsult.com/d5yhbq8kg?key=a6e7f0b5411e29ddfc4ad4b07f0bd55e",
            "https://programmesheadstoneconsult.com/fdrnenimd?key=d2bcc08643a94a794af40f3738c31c4b",
            "https://programmesheadstoneconsult.com/gq968gjnk?key=62e59ae53115a83f79c455d7f0529f0f",
            "https://programmesheadstoneconsult.com/bqrk2teaq?key=65d9e8b08ffe5f578d11104108fce958",
            "https://programmesheadstoneconsult.com/bv8w90r2?key=d74e1d59949afbcb5588a975eb262202"
        ];
        
        // DOM elements
        const initialLoader = document.getElementById('initialLoader');
        const loaderTimer = document.getElementById('loaderTimer');
        const timerText = document.getElementById('timerText');
        const popupOverlay = document.getElementById('popupOverlay');
        const closePopupBtn = document.getElementById('closePopupBtn');
        const supportBtn = document.getElementById('supportBtn');
        const adsBtn = document.getElementById('adsBtn');
        const inboxBtn = document.getElementById('inboxBtn');
        const popupCountdown = document.getElementById('popupCountdown');
        
        // Variables for timers
        let pageLoadTime = 2;
        let popupShowTime = 10;
        let pageTimerInterval;
        let popupTimerInterval;
        let popupHasBeenShown = false;
        
        // Function to get a random link from adsterraLinks array
        function getRandomLink() {
            const randomIndex = Math.floor(Math.random() * adsterraLinks.length);
            return adsterraLinks[randomIndex];
        }
        
        // Function to assign random links to buttons
        function assignRandomLinks() {
            supportBtn.href = getRandomLink();
            adsBtn.href = getRandomLink();
        }
        
        // Function to start page timer
        function startPageTimer() {
            pageLoadTime = 10;
            loaderTimer.textContent = pageLoadTime;
            timerText.textContent = `${pageLoadTime} `;
            
            pageTimerInterval = setInterval(() => {
                pageLoadTime--;
                loaderTimer.textContent = pageLoadTime;
                
                if (pageLoadTime === 1) {
                    timerText.textContent = `${pageLoadTime} `;
                } else {
                    timerText.textContent = `${pageLoadTime} `;
                }
                
                if (pageLoadTime === 0) {
                    clearInterval(pageTimerInterval);
                    initialLoader.classList.add('hidden');
                    setTimeout(showPopup, 500);
                }
            }, 1000);
        }
        
        // Function to show the popup
        function showPopup() {
            if (popupHasBeenShown) return;
            
            assignRandomLinks();
            
            popupOverlay.classList.add('active');
            document.body.style.overflow = 'hidden';
            
            popupShowTime = 10;
            popupCountdown.textContent = popupShowTime;
            
            popupTimerInterval = setInterval(() => {
                popupShowTime--;
                popupCountdown.textContent = popupShowTime;
                
                if (popupShowTime === 0) {
                    closePopup();
                }
            }, 1000);
            
            popupHasBeenShown = true;
        }
        
        // Function to close the popup
        function closePopup() {
            popupOverlay.classList.remove('active');
            document.body.style.overflow = 'auto';
            clearInterval(popupTimerInterval);
        }
        
        // Function to open link in new tab
        function openLinkInNewTab(link) {
            window.open(link, '_blank');
        }
        
        // Event listeners
        closePopupBtn.addEventListener('click', closePopup);
        
        supportBtn.addEventListener('click', function(e) {
            e.preventDefault();
            openLinkInNewTab(this.href);
            this.href = getRandomLink();
        });
        
        adsBtn.addEventListener('click', function(e) {
            e.preventDefault();
            openLinkInNewTab(this.href);
            this.href = getRandomLink();
        });
        
        // Initialize the page
        document.addEventListener('DOMContentLoaded', function() {
            if (sessionStorage.getItem('popupShown') !== 'true') {
                startPageTimer();
            } else {
                initialLoader.classList.add('hidden');
            }
            
            const originalShowPopup = showPopup;
            showPopup = function() {
                sessionStorage.setItem('popupShown', 'true');
                originalShowPopup();
            };
        });
        
        // Handle popup overlay click to close
        popupOverlay.addEventListener('click', function(e) {
            if (e.target === popupOverlay) {
                closePopup();
            }
        });
    </script>
</body>
